import React, {Component} from 'react';
import {
	BannerWrapper
}from '../style.js'

class Banner extends Component {
	render() {
		return (
			<BannerWrapper>
				<img src='../images/banner1.jpg' alt='bannerImage'/>
			</BannerWrapper>
		)
	}
}

export default Banner;
